import styles from "./MyPosts.module.css";
import Post from "./Post/Post";

const MyPosts = () => {

    const posts = [
        {id: 1, message: "Hello"},
        {id: 2, message: "Hello, girl"},
        {id: 3, message: "Hello, friend"},
        {id: 4, message: "Hello, brother"},
        {id: 5, message: "Hello"},
        {id: 6, message: "Hello"},
    ]

    const postElements = posts.map(post => <post message={post.message}/>);

    console.log(postElements)

    return (
    <div className={styles.myPost}>
        <h3>My posts</h3>
        <div>
            <div className={styles.TextArea}>
                <textarea name="" id="" cols="30" rows="2"></textarea>
            </div>
            <div>
                <button className={styles.button}>Help me</button>
            </div>
        </div>
        <div>
            <Post message={postElements} />
        </div>
    </div>
    )
}

export default MyPosts;
